using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIWebViewDelegate_Protocol/index.html#//apple_ref/occ/intf/UIWebViewDelegate	/// <summary>	/// The UIWebViewDelegate protocol defines methods that a delegate of a UIWebView object can optionally implement to intervene when web content is loaded.	/// </summary>	[iOSVersion(2)]	public interface UIWebViewDelegate	{		/// <summary>		/// Sent before a web view begins loading a frame.		/// </summary>		/// <param name="webView">The web view that is about to load a new frame.</param>		/// <param name="shouldStartLoadWithRequest">The content location.</param>		/// <param name="navigationType">The type of user action that started the load request.</param>		/// <returns>true if the web view should begin loading content; otherwise, false .</returns>		[iOSVersion(2)]		[Export("webView")]		[Optional]		bool WebView(UIWebView webView, NSURLRequest shouldStartLoadWithRequest, UIWebViewNavigationType navigationType);				/// <summary>		/// Sent after a web view starts loading a frame.		/// </summary>		/// <param name="webView">The web view that has begun loading a new frame.</param>		[iOSVersion(2)]		[Export("webViewDidStartLoad")]		[Optional]		void WebViewDidStartLoad(UIWebView webView);				/// <summary>		/// Sent after a web view finishes loading a frame.		/// </summary>		/// <param name="webView">The web view has finished loading.</param>		[iOSVersion(2)]		[Export("webViewDidFinishLoad")]		[Optional]		void WebViewDidFinishLoad(UIWebView webView);				/// <summary>		/// Sent if a web view failed to load a frame.		/// </summary>		/// <param name="webView">The web view that failed to load a frame.</param>		/// <param name="didFailLoadWithError">The error that occurred during loading.</param>		[iOSVersion(2)]		[Export("webView")]		[Optional]		void WebView(UIWebView webView, NSError didFailLoadWithError);	}}